import React, { memo } from "react";
import Profile from "./Profile";
import "./style.css";

const Header = () => {
  return (
    <nav className="nav-bar">
      <div className="right-profile">
        <Profile />
      </div>
    </nav>
  );
};

export default memo(Header);
